import React from 'react';
import Plot from 'react-plotly.js';

const Heatmap = () => {
  // Sample data: Delays by hour of day and day of week
  const data = [
    {
      z: [
        [0, 1, 0, 2, 0, 0, 1], // Sunday
        [1, 2, 3, 1, 0, 1, 2], // Monday
        [0, 1, 2, 3, 1, 0, 1], // Tuesday
        [0, 0, 1, 2, 3, 1, 0], // Wednesday
        [1, 0, 0, 1, 2, 3, 1], // Thursday
        [2, 1, 1, 0, 1, 2, 3], // Friday
        [3, 2, 1, 0, 0, 1, 2], // Saturday
      ],
      x: ['12 AM', '4 AM', '8 AM', '12 PM', '4 PM', '8 PM', '12 AM'], // Hours of the day
      y: ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'], // Days of the week
      type: 'heatmap',
      colorscale: 'YlGnBu', // Yellow-Green-Blue colorscale
    },
  ];

  return (
    <div className="heatmap-container">
      <h2 className="text-2xl text-center mb-4">Flight Delays by Hour and Day</h2>
      <Plot
        data={data}
        layout={{
          title: 'Heatmap of Delays',
          xaxis: { title: 'Hour of the Day' },
          yaxis: { title: 'Day of the Week' },
          autosize: true,
        }}
      />
    </div>
  );
};

export default Heatmap;
